description:
Hey! I wanted to introduce my 2 brothers Peter and Paul on my channel officially. They make me laugh so much! My younger brother Peter is 21 and he is a student at the University of Central Florida. My youngest brother Paul is 19 and he is a student at UCF too. Peter is into acting and musical theatre and Paul is involved with Drum Corps and Colorguard. The reason I rushed this video was because he was scheduled to leave for camp the day after we recorded this. Paul is with Carolina Crown, one of the best Drum Corps ever! I love you Peter and Paul! Paul, I cant wait to see you perform! We miss you! 

Follow us on Instagram!
@patrickstarrr
@pitasimon
@paulscript

Let me know what you all would like to see next! I will be attending BeautyCon LA! I cant wait to meet you!

xoxo
PatrickStarrr
